        "description": "El recuerdo resulta escalofriante. Basta con pensar en el atentado de un espectador contra un tenista de elite en un certamen profesional para llegar a una simple conclusión:  es imposible. Pero la realidad, a veces, se ríe de la ficción. Sucedió. Aquel feroz ataque cambiaría la historia del tenis para siempre.\n\nTodo marchaba con cierta normalidad aquel 30 de abril de 1993. Monica Seles, la joven número uno del mundo, sostenía una ventaja de 6-4 y 4-3 frente a la búlgara Magdalena Maleeva en la cancha central del torneo de Hamburgo, en un choque correspondiente a los cuartos de final. Toda esa calma que suele reinar en los acontecimientos de tenis, de repente, se desmoronó por completo: una persona del público burló los controles de seguridad durante el cambio de lado y apuñaló por la espalda a la yugoslava, quien aguardaba la reanudación sentada en el banco.\n\nSuscribite al canal de @Pagina12 https://www.youtube.com/pagina12  \n\nSeguinos en:\nFacebook: https://www.facebook.com/Pagina12ok/\nTwitter: https://twitter.com/pagina12\nInstagram: https://www.instagram.com/pagina12/\n\nMás información en: https://www.pagina12.com.ar/\nHacete soci@ de Página/12: https://bit.ly/2UsFsq6",
